Hace muchos años viajo a SANTA FE a compartir danza. Ya tengo amigues y alumnes también. Así los siento. Los veo verano tras verano y me emociona mucho compartir sus procesos. Mates de pomelo coronan mis respiraciones entre pasada y pasada. Las clases en el teatro tienen una mística que no sé cómo llamarla. A veces alguien canta, otras aparece un bombo o un acordeón, otras nos quedamos entre abrazos y silencios o charlas hasta la madrugada. La primera vez que fui, hasta remeras del seminario habían hecho! Cosas que no se olvidan, por eso uno siempre vuelve, por el amor que después se hace danza para siempre.
El 4 y 5 de Marzo ando por allá…felicidad.

