Cordoba es una de las primeras provincias que viaje a compartir seminario. Lo especial de esto es que cada encuentro es entre el afecto y la danza una fiesta de emoción, intercambio y alegría. Volver a ver personas que después de muchos años seguimos disfrutando de este intensivo que nos revuelve el corazón, el tiempo y las ganas. Regresar después de pandemia era un gran deseo….este finde se cumple y nos bailamos todo! 
Estas imágenes las tomo @alesso.ph en el último encuentro. Que felicidad! 
@lauraluciamiranda ya!

Hay mucho en estas imágenes, mucho más de lo que se ve. Nos juntamos con un sueño muy enorme y mucho deseo. Y acá estamos con un mes de funciones y una valija de anécdotas y experiencia que no la olvidaremos más. Cada persona de este equipo de 130 amamos este proyecto. Ensayos miles de horas, pasadas cientas, paciencia millones, almuerzos juntes  muchísimos…niñes corriendo por todos lados y deslumbrandonos con su vocación. Volvimos a jugar, volvimos a encender la ternura y recordamos que siempre es mejor en equipo. @matildaelmusical sos mi sueño posible y me estás haciendo muy feliz. Gracias a cada corazón que lo está dando todo desde el día en que esta locura nos encontró imaginándola, nos dio el coraje y la fuerza  para construirla y hoy la dicha de disfrutarla. 

