Anoche en la entrega de los @premiosace , celebramos con la familia de @matildaelmusical las tres estatuillas  de campeones del mundo del amor y el trabajo en equipo. Porque los premios son un abrazo a todo lo que dejamos y damos por el teatro, nos dan la posibilidad de reencontrarnos, recordar los procesos, seguir creyendo en nuestras vocaciones, volver a abrazarnos, reirnos de todo y de nada y celebrar. 
Esta familia es enorme, de corazón, de profesión, de potencia y sensibilidad. Lo dimos todo para hacer este musical, todo y un poco más, y cada función, cada encuentro superó las espectativas de belleza, ganas, compañerismo y grupalidad y podemos afirmar que cada unx tuvo que ver  con que eso sea así, así que gracias por haberlo hecho amigxs. Los amo 
